import React from "react";

import logo from '../assets/logo.png';
import mainImage from '../assets/mainImage.png';
import dummy from '../assets/dummy.png';

import '../style/Home.css';

function Home() {
    return (
        <>

            {/* hero section  */}
            <section className="hero-section">
                <div className="hero-section-main-div">
                    <div className="hero-inner-section-div">
                        {/* first div for menu */}
                        <div className="hero-section-inner-first-div">

                            <div className="hero-section-logo">
                                <img src={logo} alt="vishal" />
                            </div>

                            <div className="hero-section-menus">
                                <ul>
                                    <li className="text-[#b6b5b0]">Home</li>
                                    <li className="text-[#b6b5b0]">About Me</li>
                                    <li className="text-[#b6b5b0]">Experience</li>
                                    <li className="text-[#b6b5b0]">My Work</li>
                                    <li className="text-[#b6b5b0]">Skills</li>
                                    <li className="text-[#b6b5b0]">Connect With Me</li>
                                </ul>
                            </div>

                        </div>
                        {/* second div for middle content and heading  */}
                        <div className="hero-section-second-div">
                            <span>Availbale to work</span>
                            <span>Hi, I’m Vishal Choudhary,</span>
                            <h1>Frontend Developer</h1>
                            <p>I’m specialize in various areas of design, such as product design, web design, branding, and visual elements etc.</p>
                        </div>

                        {/* third div for profile with image */}
                        <div className="hero-section-third-div">

                        </div>
                    </div>
                </div>
            </section>
        </>
    )
}

export default Home;
